import React from "react";
import { FaLocationArrow } from "react-icons/fa";

function Nav() {
  return (
    <nav>
      <ul>
        <li>Home</li>
        <button>
          <FaLocationArrow />
        </button>
        <li>Login</li>
      </ul>
    </nav>
  );
}

export default Nav;
